public class propOfPrimes { public static boolean isPrimeNumber(int num) { for (int i = 2; i <= (Math.sqrt(num + 1)); i++) { if (num % i == 0) { return false; }} return true;   } public static double propOfPrimes(int start, int end){    double amountOfPrime = 0;    double amountOfNumbers = end - start + 1;    for(int i = start; i <= end; i++) {        if (isPrimeNumber(i)){            amountOfPrime++;        }    }    return amountOfPrime/amountOfNumbers;}  public static void main(String[] args) {System.out.println(propOfPrimes(5, 14));} }